import React from 'react';

const Summary = ({ summary }) => {
  const topics = summary.split('**Topic');

  return (
    <div className="summary">
      <h2>Summary</h2>
      {topics.map((topic, index) => {
        if (index === 0) return null;
        const [topicHeading, topicContent] = topic.split('\n', 2);
        return (
          <div key={index}>
            <h3><strong>Topic {index}</strong></h3>
            <p>{topicContent}</p>
          </div>
        );
      })}
    </div>
  );
}

export default Summary;
